def p_voigt(n,b,wave,lambdao,gamma,f):
    
    c       = 299792458.
    b       = (b+0) * 1000
    nn      = float(10**n)
    u       = (c/b)*(lambdao/wave-1)
    wave    = wave*(10**(-10))
    lambdao = lambdao*10**(-10)
    a       = lambdao*gamma/(4*math.pi*b)
    H       = voigt(a,u)
    tau     = 0
    wave    = wave*10**(10)    # in Angstrom
    b       = b/1000           # in km/s
    tau     = 1.497*10**(-15)*nn*f*wave*H/b
    lambdao = lambdao*10**(10)
    
    return numpy.exp(-tau)
    
